        aboutUs.style.zIndex = 1;
      } else if (newPageDestination === 'makeAppointment') {
        home.style.zIndex = 1;
        makeAppointment.style.zIndex = 2;
        aboutUs.style.zIndex = 1;
      } else if (newPageDestination === 'aboutAndContact') {
        home.style.zIndex = 1;
        makeAppointment.style.zIndex = 1;
        aboutUs.style.zIndex = 2;
      } 
  }

  return (
    <div className="App">
      <MenuBanner />
      <Home />
      <MakeAppointment />
      <AboutAndContact />
    </div>
  );
}

export default App;
